window.bookSummaryJSON = "<p>The hit Audible Original series from executive producers of <i>The Walking Dead</i> and the writer of <i>Pacific Rim</i> returns for its highly anticipated second season.</p> <p>Six months have passed since the Vampire Queen fell silent, and the world balances on a knife’s edge. Rejoin the courageous Dunraven sisters, Darcy and Hope, as they navigate the vampire apocalypse in a sunless, endless winter that grows deadlier with each passing day. Brace yourself for a frigid realm of sacred daggers, mighty swords, secret seaside caves, unthinkable human blood farms, and a superpowered vampire villain on the hunt. Will Darcy emerge from hiding to save her sister? Will Hope venture from the castle refuge and find Darcy first? When all paths converge, everyone in Hope and Darcy’s orbit is in mortal danger, including the sisters themselves.</p> <p>Dare to listen in the dark again as this thrilling saga expands to new lands, new loves, new weapons, and new warriors. Presented in Dolby Atmos spatial audio, the second season of Impact Winter is designed to haunt you like never before. Hear your heart stop.</p> <p><b>Please note: This content is for mature audiences only. It contains adult language and themes. Discretion is advised.</b></p>"; 
